import React from 'react';
import ReactDOM from 'react-dom';
import styles from './applicantInfo.module.css';

class ApplicantInfo extends React.Component {
	constructor(props){
		super(props);

	}
	render(){
		return(
		  <div className={styles.divEl}>
		    <p>{this.props.info.name}</p>
		    <p>{this.state.placeOfEmployment}</p>
		    <p>{this.state.addres}</p>
		  </div>
		);
	}
} 

export default ApplicantInfo;
